const object = { 'a': 1, 'b': 2 }

const values = memoize(values)
values(object)
// => [1, 2]

values(object)
// => [1, 2]

object.a = 2
values(object)
// => [2, 2]

// Modify the result cache.
values.cache.set(object, ['a', 'b'])
values(object)
// => ['a', 'b']

// Replace `memoize.Cache`.
memoize.Cache = WeakMap

